E_D("replace into `phome_ecms_game` values('3208','18','0','','','','1','admin','','1','0','1343230164','0','0','0','0','','','3208','0','0','0','0','0','0','小鸭子找朋友','1343230164','/spic/20120725/8763.gif','0','1','1343230164','0','3','1','0','','0','','/d/file/swf/xiaoya.swf','667','479','','1','','0','','1','/dpic/20120725/8764.gif','730','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlURE5vY0ZsWE9UVlpVelY2WkRKWlBRPT0=','0','0','http://s.61baobao.com/common/flash/2006/xiaoya.swf','http://www.61baobao.com/common/flash/2006/dpic/xiaoya.gif','http://www.61baobao.com/common/flash/2006/pic/730.gif','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('3209','18','0','','','','1','admin','','1','0','1343230165','0','0','0','0','','','3209','0','0','0','0','0','0','小马过河','1343230165','/spic/20120725/8841.jpg','0','1','1343230165','0','3','1','0','','0','','/d/file/swf/xiaomaguohe.swf','667','479','《小马过河》原文： <br />小马过河 <br />小马和他的妈妈住在绿草茵茵的十分美丽的小河边。除了妈妈过河给河对岸的村子送粮 <br />食的时候，他总是跟随在妈妈的身边寸步不离。 <br />他过的很快乐，时光飞快地过去了。 <br />有一天，妈妈把小马叫到身边说：“小马，你已经长大了，可以帮妈妈做事了。今天你 <br />把这袋粮食送到河对岸的村子里去吧。” <br />小马非常高兴地答应了。他驮着粮食飞快地来到了小河边。可是河上没有桥，只能自己 <br />淌过去。可又不知道河水有多深呢？犹豫中的小马一抬头，看见了正在不远处吃草的牛伯 <br />伯。小马赶紧跑过去问到：“牛伯伯，您知道那河里的水深不深呀？” <br />牛伯伯挺起他那高大的身体笑着说：“不深，不深。才到我的小腿。”小马高兴地跑回 <br />河边准备淌过河去。他刚一迈腿，忽然听见一个声音说：“小马，小马别下去，这河可深 <br />啦。”小马低头一看，原来是小松鼠。小松鼠翘着她的漂亮的尾巴，睁者圆圆的眼睛，很认 <br />真地说： <br />“前两天我的一个伙伴不小心掉进了河里，河水就把他卷走了。”小马一听没主意了。 <br />牛伯伯说河水浅，小松鼠说河水深，这可怎么办呀？只好回去问妈妈。 <br />马妈妈老远地就看见小马低着头驮着粮食又回来了。心想他一定是遇到困难了，就迎过 <br />去问小马。小马哭着把牛伯伯和小松鼠的话告诉了妈妈。妈妈安慰小马说：“没关系，咱们 <br />一起去看看吧。” <br />小马和妈妈又一次来到河边，妈妈这回让小马自己去试探一下河水有多深。小马小心地 <br />试探着，一步一步地淌过了河。噢，他明白了，河水既没有牛伯伯说的那么浅，也没有小松 <br />鼠说的那么深。只有自己亲自试过才知道。 <br />小马深情地向妈妈望了一眼，心里说：“谢谢你了，好妈妈。” <br />然后他转头向村子跑去。他今天特别高兴，你知道是为什么吗？','1','','0','','1','/dpic/20120725/8842.jpg','728','VEROd01Fd3pSbkJpYlVwb1luazVOR0ZYUm5aaVYwWnVaRmM1YjFwVE5YcGtNbGs5','0','0','http://s.61baobao.com/zt/qinbao/xiaomaguohe.swf','http://www.61baobao.com/zt/qinbao/dpic/xiaomaguohe.jpg','http://www.61baobao.com/zt/qinbao/pic/xiaomaguohe.jpg','0','三个月以上','0','','0','','0','0','0');");
