E_D("replace into `phome_ecms_game` values('3218','18','0','','','','1','admin','','1','0','1343230168','0','0','0','0','','','3218','0','0','0','0','0','0','妈妈生病了','1343230168','/spic/20120725/8767.gif','0','1','1343230168','0','3','1','0','','0','','/d/file/swf/mamashengbingle.swf','667','479','','1','','0','','1','/dpic/20120725/8768.gif','721','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlUREl4YUdKWFJucGhSMVoxV2pKS2NHSnRaSE5hVXpWNlpESlpQUT09','0','0','http://s.61baobao.com/common/flash/2006/mamashengbingle.swf','http://www.61baobao.com/common/flash/2006/dpic/mamashengbingle.gif','http://www.61baobao.com/common/flash/2006/pic/721.gif','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('3219','18','0','','','','1','admin','|30|','1','0','1343230168','0','0','0','0','','','3219','0','0','0','0','0','0','小蝌蚪找妈妈','1343230168','/spic/20120725/8885.jpg','0','1','1343230168','0','3','1','0','','0','','/d/file/swf/xiaokedou.swf','667','479','    小蝌蚪找妈妈<br />   暖和的春天来了，池塘里的冰融化了，柳树长出了绿色的叶子。 　　青蛙妈妈在泥洞里睡了一个冬天，也醒来了。她从泥洞里慢慢地爬出来，伸了伸腿，扑通一声，跳进池塘里，在碧绿的水草上，生下了许多黑黑的、圆圆的卵。 　　春风吹着，阳光照着，池塘里的水越来越暖和了，青蛙妈妈生下的卵，慢慢地活动起来，变成一群大脑袋、长尾巴的小蝌蚪。 　　小蝌蚪在水里游来游去，非常快乐。 　　有一天，鸭妈妈带着小鸭到池塘来游水。小鸭子们跟在妈妈后面，嘎嘎嘎叫着。小蝌蚪看见了，就想起了自己的妈妈。 　　他们你问我，我问你：“我们的妈妈在哪里呢？”可是谁也不知道。 　　他们一齐游到鸭妈妈身边，问：“鸭妈妈，鸭妈妈，您看见过我们的妈妈吗？您告诉我们，她在哪里？” 　　鸭妈妈亲热地回答说：“看见过。你们的妈妈有两只大眼睛，嘴巴又阔又大。好孩子，你们到前面去找吧！” 　　“谢谢您，鸭妈妈！”小蝌蚪高高兴兴地向前面游去。 　　一条大金鱼游过来了，小蝌蚪看见大金鱼头顶上有两只大眼睛，嘴巴又阔又大。他们想：一定是妈妈来了，就追上去喊：“妈妈！妈妈！” 　　大金鱼笑着说：“我不是你们的妈妈。我是小金鱼的妈妈。你们的妈妈肚皮是白的，好孩子，你们去找吧！” 　　“谢谢您！金鱼妈妈！”小蝌蚪又向前面游去。 　　一只大螃蟹从对面游了过来。小蝌蚪看见螃蟹的肚皮是白的，就迎上去大声叫：“妈妈！妈妈！” 　　螃蟹摆着两只大钳子，笑着说：“我不是你们的妈妈。你们的妈妈只有四条腿，你们看我有几条腿呀？” 　　小蝌蚪一数，螃蟹有八条腿，就不好意思地说：“对不起呀，我们认错了。” 　　一只大乌龟在水里慢慢地游着，后面跟着一只小乌龟。小蝌蚪游到大乌龟跟前，仔细数着大乌龟的腿：“一条，两条，三条，四条。四条腿！四条腿！这回可找到妈妈啦！” 　　小乌龟一听，急忙爬到大乌龟的背上，昂着头说：“你们认错啦，她是我的妈妈。” 　　大乌龟笑着说：“你们的妈妈穿着好看的绿衣裳，唱起歌来‘呱呱呱’，走起路来一蹦一跳。好孩子，快去找她吧！” 　　“谢谢您，乌龟妈妈。”小蝌蚪再向前面游过去。 　　小蝌蚪游呀游呀，游到池塘边，看见一只青蛙，坐在圆圆的荷叶上“呱呱呱”地唱歌。 　　小蝌蚪游过去，小声地问：“请问您：您看见我们的妈妈吗？她有两只大眼睛，嘴巴又阔又大，四条腿走起路来一蹦一跳的，白白的肚皮绿衣裳，唱起歌来呱呱呱……” 　　青蛙没等小蝌蚪说完，就“呱呱呱”大笑起来。她说：“傻孩子，我就是你们的妈妈呀，我已经找了你们好久啦！” 　　小蝌蚪听了，一齐摇摇尾巴说：“奇怪！奇怪！为什么我们长得跟您不一样呢？” 　　青蛙笑着说：“你们还小呢。过几天，你们会长出两条后腿来；再过几天，又会长出两条前腿。四条腿长齐了，脱掉尾巴，换上绿衣裳，就跟妈妈一样了。那时候，你们就可以跳到岸上去捉虫吃啦。” 　　小蝌蚪听了，高兴得在水里翻起跟斗来：“呵！我们找到妈妈了！我们找到妈妈了！” 　　青蛙扑通一声跳进水里，带着小蝌蚪一块儿游玩去了。 　　后来小蝌蚪长大了，变成了小青蛙。小青蛙常常跳到岸上捉虫吃，还快活地唱着：“呱呱呱，呱呱呱，我们长大啦！我们长大啦！我们会捉虫，捉尽了害虫，保护庄稼。”','1','','0','','1','/dpic/20120725/8886.jpg','716','VEROd01Fd3pSbkJpYlVwb1luazVOR0ZYUm5aaE1sWnJZak5WZFdNelpHMD0=','0','0','http://s.61baobao.com/zt/qinbao/xiaokedou.swf','http://www.61baobao.com/zt/qinbao/dpic/xiaokedou.jpg','http://www.61baobao.com/zt/qinbao/pic/xiaokedou.jpg','0','三个月以上','0','','0','','0','0','0');");
