E_D("replace into `phome_ecms_game` values('3285','21','0','','','','1','admin','|63|','1','0','1343230198','0','0','0','0','','','3285','0','0','0','0','0','0','画蛇添足','1343230198','/spic/20120725/9767.gif','0','1','1343230198','0','3','1','0','','0','','/d/file/swf/huashetianzu.swf','667','479','画蛇添足: 典故　　 楚有祠者，赐其舍人卮酒.舍人相谓曰：“数人饮之不足，一人饮之有余。请画地为蛇，先成者饮酒。”   　　一人蛇先成引酒且饮之乃左手持卮右手画蛇，曰：“吾能为之足。”未成，一人之蛇成，夺其卮,曰：“蛇固无足，子安能为之足？”遂饮其酒。   　　为蛇足者，终亡其酒。   解释 　　画蛇时给蛇添上脚。比喻做了多余的事，非但无益，反而不合适。也比喻虚构事实，无中生有。给蛇添足的那个人，正是因为做了多余的事，才失掉了到嘴的好酒。这个说明，做任何事情都要切合实际一点，不要做那些多余的事情。','1','','0','','1','/dpic/20120725/9768.gif','880','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlUREpvTVZsWVRtOWFXRkp3V1ZjMU5tUlROWHBrTWxrOQ==','0','0','http://s.61baobao.com/common/flash/2006/huashetianzu.swf','http://www.61baobao.com/common/flash/2006/dpic/huashetianzu.gif','http://www.61baobao.com/common/flash/2006/pic/880.gif','0','三个月以上','0','','0','','0','0','0');");
