E_D("replace into `phome_ecms_game` values('3313','21','0','','','','1','admin','|63|','1','0','1343230213','0','0','0','0','','','3313','0','0','0','0','0','0','囫囵吞枣','1343230213','/spic/20120725/9876.gif','0','1','1343230213','0','3','1','0','','0','','/d/file/swf/4510.swf','667','479','从前有个人看书的时候，总会把书中文章大声念出来，可是他从来不动脑筋想一想书中的道理，还自以为看了很多书，懂得许多道理。有一天，他参加朋友的聚会，大家边吃边聊，其中有一位客人感慨地说：“这世上很少有两全其美的事，就拿吃水果来说，梨对牙齿很好，但是吃了伤胃；枣子能健胃，可惜吃多了会伤牙齿。”大家都觉得很有道理。 这个人为了表现自己的聪明，就接下去说：“这很简单嘛！吃梨子时不要吃进果肉，就不会伤胃；吃枣子时用吞的，就不会伤牙啦！”这时桌上正好有一盘枣子，他便拿起枣子打算直接吞下去。大家怕他噎到，连忙劝他说：“千万别吞，卡在喉咙多危险呀！”<br /><br />释义：比喻对事物不加分析思考，笼统地接受','1','','0','','1','/dpic/20120725/9877.gif','867','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET1d0TWVsRXhUVlJCZFdNelpHMD0=','0','0','http://s.61baobao.com/common/flash/d/4510.swf','http://www.61baobao.com/common/flash/d/dpic/4510.gif','http://www.61baobao.com/common/flash/d/pic/4510.gif','0','三个月以上','0','','0','','0','0','0');");
