E_D("replace into `phome_ecms_game` values('3339','24','0','','','','1','admin','','1','0','1343230228','0','0','0','0','','','3339','0','0','0','0','0','0','乐不思蜀','1343230228','/spic/20120725/10284.gif','0','1','1343230228','0','3','1','0','','0','','/d/file/swf/23lebusishu.swf','667','479','三国时期，刘备占据蜀地，建立蜀国。他死后，儿子刘禅继位，又称刘阿斗。刘禅昏庸无能，在那些有才能的大臣死后，公元263年，蜀国就被魏所灭。刘禅投降后，魏王曹髦（máo）封他一个食俸禄无实权的“安乐公”称号，并将他迁居魏国都城洛阳居住。魏王自己也无实权，掌大权的是司马昭。在一次宴会上，司马昭当着刘禅的面故意安排表演蜀地的歌舞。刘禅随从人员想到灭亡的故国，都非常难过，刘禅却对司马昭说：“此间乐，不思蜀。”他一点儿也不想念蜀国。','1','','0','','1','/dpic/20120725/10285.gif','964','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlUSHBKZW1KSFZtbGtXRTV3WXpKb01VeHVUak5hWnowOQ==','0','0','http://s.61baobao.com/common/flash/2006/23lebusishu.swf','http://www.61baobao.com/common/flash/2006/dpic/23lebusishu.gif','http://www.61baobao.com/common/flash/2006/pic/964.gif','0','三个月以上','0','','0','','0','0','0');");
