E_D("replace into `phome_ecms_game` values('3418','20','0','','','','1','admin','','1','0','1343230261','0','0','0','0','','','3418','0','0','0','0','0','0','狼来了','1343230261','/spic/20120725/10864.jpg','0','1','1343230261','0','3','1','0','','0','','/d/file/swf/3255.swf','667','479','从前，有个放羊娃，每天都去山上放羊。 　　一天，他觉得十分无聊，就想了个捉弄大家寻开心的主意。他向着山下正在种田的农夫们大声喊：“狼来了！狼来了！救命啊！”农夫们听到喊声急忙拿着锄头和镰刀往山上跑，他们边跑边喊：“不要怕，孩子，我们来帮你打恶狼！” 　　农夫们气喘吁吁地赶到山上一看，连狼的影子也没有！放羊娃哈哈大笑：“真有意思，你们上当了！”农夫们生气地走了。 　　第二天，放羊娃故伎重演，善良的农夫们又冲上来帮他打狼，可还是没有见到狼的影子。 　　放羊娃笑得直不起腰：“哈哈！你们又上当了！哈哈！” 　　大伙儿对放羊娃一而再再而三地说谎十分生气，从此再也不相信他的话了。 　　过了几天，狼真的来了，一下子闯进了羊群。放羊娃害怕极了，拼命地向农夫们喊：“狼来了！狼来了！快救命呀！狼真的来了！” 　　农夫们听到他的喊声，以为他又在说谎，大家都不理睬他，没有人去帮他，结果放羊娃的许多羊都被狼咬死了。 ','1','','0','','1','/dpic/20120725/10865.jpg','821','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjNUSHBOZVU1VVZYVmpNMlJ0','0','0','http://s.61baobao.com/common/flash/2010/3255.swf','http://www.61baobao.com/common/flash/2010/dpic/3255.jpg','http://www.61baobao.com/common/flash/2010/pic/3255.jpg','0','三个月以上','0','','0','','0','0','0');");
