E_D("replace into `phome_ecms_game` values('3464','22','0','','','','1','admin','','1','0','1343230279','0','0','0','0','','','3464','0','0','0','0','0','0','十个太阳','1343230279','/spic/20120725/11170.gif','0','1','1343230279','0','3','1','0','','0','','/d/file/swf/shigetaiyang01.swf','667','479','世界年轻时，天空曾一齐出现十个太阳。他们的母亲是东方天帝的妻子。她常把十个孩子放在世界最东边的东海洗澡。洗完澡后，他们像小鸟那样栖息在一棵大树上，因为每个太阳的中心是只鸟。九个太阳栖息在长得较矮的树枝上，另一个太阳则栖息在树梢上，每夜一换。','1','','0','','1','/dpic/20120725/11171.gif','908','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlURE5PYjJGWFpHeGtSMFp3WlZkR2RWcDZRWGhNYms0eldtYzlQUT09','0','0','http://s.61baobao.com/common/flash/2006/shigetaiyang01.swf','http://www.61baobao.com/common/flash/2006/dpic/shigetaiyang01.gif','http://www.61baobao.com/common/flash/2006/pic/908.gif','0','三个月以上','0','','0','','0','0','0');");
