E_D("replace into `phome_ecms_game` values('3466','18','0','','','','1','admin','','1','0','1343230280','0','0','0','0','','','3466','0','0','0','0','0','0','保护眼睛','1343230280','/spic/20120725/11168.gif','0','1','1343230280','0','3','1','0','','0','','/d/file/swf/bbeg_053.swf','667','479','','1','','0','','1','/dpic/20120725/11169.gif','614','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlUREpLYVZwWFpHWk5SRlY2VEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2006/bbeg_053.swf','http://www.61baobao.com/common/flash/2006/dpic/bbeg_053.gif','http://www.61baobao.com/common/flash/2006/pic/614.gif','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('3467','22','1','','','','1','admin','','1','0','1343230280','0','0','0','0','','','3467','0','0','0','0','0','0','夸父逐日','1343230280','/spic/20120725/11184.jpg','0','1','1343230280','0','3','1','0','','0','','/d/file/swf/kuafuzhuri01.swf','667','479','这是我国最早的著名神话之一，讲的是夸父奋力追赶太阳、长眠虞渊的故事。夸父是古代神话传说中的一个巨人，是幽冥之神后土的后代，住在北方荒野的成都载天山上。他双耳挂两条黄蛇、手拿两条黄蛇，去追赶太阳。当他到达太阳将要落入的禺谷之际，觉得口干舌燥，便去喝黄河和渭河的水，河水被他喝干后，口渴仍没有止住。他想去喝北方大湖的水，还没有走到，就渴死了。夸父临死，抛掉手里的杖，这杖顿时变成了一片鲜果累累的桃林，为后来追求光明的人解除口渴。','1','','0','','1','/dpic/20120725/11185.jpg','909','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlUREowTVZsWFdqRmxiV2d4WTIxcmQwMVROWHBrTWxrOQ==','1','0','http://s.61baobao.com/common/flash/2006/kuafuzhuri01.swf','http://www.61baobao.com/common/flash/2006/dpic/kuafuzhuri01.jpg','http://www.61baobao.com/common/flash/2006/pic/909.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('3468','21','0','','','','1','admin','|63|','1','0','1343230281','0','0','0','0','','','3468','0','0','0','0','0','0','抛砖引玉','1343230281','/spic/20120725/11384.gif','0','1','1343230281','0','3','1','0','','0','','/d/file/swf/g155.swf','667','479','','1','','0','','1','/dpic/20120725/11385.gif','834','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlUREpqZUU1VVZYVmpNMlJ0','0','0','http://s.61baobao.com/common/flash/2006/g155.swf','http://www.61baobao.com/common/flash/2006/dpic/g155.gif','http://www.61baobao.com/common/flash/2006/pic/834.gif','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('3469','22','0','','','','1','admin','','1','0','1343230281','0','0','0','0','','','3469','0','0','0','0','0','0','东郭先生','1343230281','/spic/20120725/11180.gif','0','1','1343230281','0','3','1','0','','0','','/d/file/swf/dongguoxian.swf','667','479','玉帝为了给人们排定生肖，决定在天廷里召开一个上肖大会。他给各种动物发了道开会的圣旨。那时候，猫和老鼠是很要好的朋友。它们生活在一起，像兄弟一样。开上肖大会的圣旨送到了猫和老鼠那里，它们都很高兴，决定一起去参加。猫很会打瞌睡，它自己也知道这一点，所以在开会前一天，就预先和老鼠打了招呼。','1','','0','','1','/dpic/20120725/11181.gif','906','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlUREpTZG1KdFpHNWtWemswWVZkR2RVeHVUak5hWnowOQ==','0','0','http://s.61baobao.com/common/flash/2006/dongguoxian.swf','http://www.61baobao.com/common/flash/2006/dpic/dongguoxian.gif','http://www.61baobao.com/common/flash/2006/pic/906.gif','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('3470','24','0','','','','1','admin','','1','0','1343230281','0','0','0','0','','','3470','0','0','0','0','0','0','长板桥（2）','1343230281','/spic/20120725/11196.gif','0','1','1343230281','0','3','1','0','','0','','/d/file/swf/6changbanqiao2.swf','667','479','','1','','0','','1','/dpic/20120725/11197.gif','940','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlUSHBhYW1GSFJuVmFNa3BvWW01R2NGbFhPSGxNYms0eldtYzlQUT09','0','0','http://s.61baobao.com/common/flash/2006/6changbanqiao2.swf','http://www.61baobao.com/common/flash/2006/dpic/6changbanqiao2.gif','http://www.61baobao.com/common/flash/2006/pic/940.gif','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('3471','22','0','','','','1','admin','','1','0','1343230282','0','0','0','0','','','3471','0','0','0','0','0','0','猫和老鼠','1343230282','/spic/20120725/11192.jpg','0','1','1343230282','0','3','1','0','','0','','/d/file/swf/maohelaoshu0220.swf','667','479','楚国有一个名叫南郭子綦的人，据说也是德行高洁的抱道之士。有一天，南郭子綦在家无事，靠着一只案几静坐，他意守丹田，仰天呼吸，一会儿就扫除了各种杂念，凝神人静，渐渐地物我皆忘，达到了“天地与我并生，万物与我合一”的境地。','1','','0','','1','/dpic/20120725/11193.jpg','907','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlUREl4YUdJeWFHeGlSMFoyWXpKb01VMUVTWGxOUXpWNlpESlpQUT09','0','0','http://s.61baobao.com/common/flash/2006/maohelaoshu0220.swf','http://www.61baobao.com/common/flash/2006/dpic/maohelaoshu0220.jpg','http://www.61baobao.com/common/flash/2006/pic/1363.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('3472','21','0','','','','1','admin','|63|','1','0','1343230282','0','0','0','0','','','3472','0','0','0','0','0','0','狼狈为奸','1343230282','/spic/20120725/11188.gif','0','1','1343230282','0','3','1','0','','0','','/d/file/swf/g152.swf','667','479','','1','','0','','1','/dpic/20120725/11190.gif','835','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlUREpqZUU1VVNYVmpNMlJ0','0','0','http://s.61baobao.com/common/flash/2006/g152.swf','http://www.61baobao.com/common/flash/2006/dpic/g152.gif','http://www.61baobao.com/common/flash/2006/pic/835.gif','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('3473','24','0','','','','1','admin','','1','0','1343230283','0','0','0','0','','','3473','0','0','0','0','0','0','三顾茅庐（2）','1343230283','/spic/20120725/11202.gif','0','1','1343230283','0','3','1','0','','0','','/d/file/swf/5sangu2.swf','667','479','汉末，黄巾事起，天下大乱，曹操坐据朝廷，孙权拥兵东吴，汉宗室豫州牧刘备听徐庶和司马徽说诸葛亮很有学识，又有才能，就和关羽、张飞带着礼物到隆中（今河南南阳城西，一说为湖北襄阳城西南）卧龙岗去请诸葛亮出山辅佐他。恰巧诸葛亮这天出去了，刘备只得失望地回去。不久，刘备又和关羽、张飞冒着大风雪第二次去请。不料诸葛亮又出外闲游去了。张飞本不愿意再来，见诸葛亮不在家，就催着要回去。刘备只好留下一封信，表达自己对诸葛亮的敬佩和请他出来帮助自己挽救国家危险局面的意思。 过了一段时间，刘备吃了三天素之后，准备再去请诸葛亮。关羽说诸葛亮也许是徒有虚名，未必有真才实学，不用去了。张飞却主张由他一个人去叫，如他不来，就用绳子把他捆来。刘备把张飞责备了一顿，又和他俩第三次请诸葛亮。当他们到诸葛亮家前，已经是中午，诸葛亮正在睡觉。刘备不敢惊动他，一直站到诸葛亮醒来，才彼此坐下谈话。<br /><br />三顾茅庐：比喻真心诚意，一再邀请、拜访有专长的贤人。','1','','0','','1','/dpic/20120725/11203.gif','938','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlUSHBXZWxsWE5XNWtWRWwxWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2006/5sangu2.swf','http://www.61baobao.com/common/flash/2006/dpic/5sangu2.gif','http://www.61baobao.com/common/flash/2006/pic/938.gif','0','三个月以上','0','','0','','0','0','0');");
