E_D("replace into `phome_ecms_game` values('3478','20','0','','','','1','admin','','1','0','1343230285','0','0','0','0','','','3478','0','0','0','0','0','0','懒驴','1343230285','/spic/20120725/11290.gif','0','1','1343230285','0','3','1','0','','0','','/d/file/swf/lanlv011.swf','667','479','','1','','0','','1','/dpic/20120725/11291.gif','812','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlUREo0YUdKdGVESk5SRVY0VEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2006/lanlv011.swf','http://www.61baobao.com/common/flash/2006/dpic/lanlv011.gif','http://www.61baobao.com/common/flash/2006/pic/812.gif','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('3479','24','1','','','','1','admin','','1','0','1343230285','0','0','0','0','','','3479','0','0','0','0','0','0','三顾茅庐（1）','1343230285','/spic/20120725/11300.jpg','0','1','1343230285','0','3','1','0','','0','','/d/file/swf/5sangu1.swf','667','479','汉末，黄巾事起，天下大乱，曹操坐据朝廷，孙权拥兵东吴，汉宗室豫州牧刘备听徐庶和司马徽说诸葛亮很有学识，又有才能，就和关羽、张飞带着礼物到隆中（今河南南阳城西，一说为湖北襄阳城西南）卧龙岗去请诸葛亮出山辅佐他。恰巧诸葛亮这天出去了，刘备只得失望地回去。不久，刘备又和关羽、张飞冒着大风雪第二次去请。不料诸葛亮又出外闲游去了。张飞本不愿意再来，见诸葛亮不在家，就催着要回去。刘备只好留下一封信，表达自己对诸葛亮的敬佩和请他出来帮助自己挽救国家危险局面的意思。 过了一段时间，刘备吃了三天素之后，准备再去请诸葛亮。关羽说诸葛亮也许是徒有虚名，未必有真才实学，不用去了。张飞却主张由他一个人去叫，如他不来，就用绳子把他捆来。刘备把张飞责备了一顿，又和他俩第三次请诸葛亮。当他们到诸葛亮家前，已经是中午，诸葛亮正在睡觉。刘备不敢惊动他，一直站到诸葛亮醒来，才彼此坐下谈话。<br /><br />三顾茅庐：比喻真心诚意，一再邀请、拜访有专长的贤人。','1','','0','','1','/dpic/20120725/11301.jpg','937','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlUSHBXZWxsWE5XNWtWRVYxWXpOa2JRPT0=','1','0','http://s.61baobao.com/common/flash/2006/5sangu1.swf','http://www.61baobao.com/common/flash/2006/dpic/5sangu1.jpg','http://www.61baobao.com/common/flash/2006/pic/937.jpg','0','三个月以上','0','','0','','0','0','0');");
