E_D("replace into `phome_ecms_game` values('3528','14','6','','','','1','admin','|9|19|26|44|57|','1','0','1343236592','0','0','0','1','','','3528','0','0','0','0','0','0','世上只有妈妈好','1343236592','/spic/20120725/1962.jpg','0','1','1343611458','0','3','1','0','','1','','/d/file/swf/mamahao.swf','667','479','亲宝儿歌为您倾情呈现儿歌——世上只有妈妈好<br />世上只有妈妈好，<br />有妈的孩子像块宝，<br />投进妈妈的怀抱，<br />幸福享不了;<br />世上只有妈妈好，<br />没妈的孩子像根草，<br />离开妈妈的怀抱，<br />幸福哪里找。','1','','0','','1','/dpic/20120725/1963.jpg','11794','VEROd01Fd3pSbkJpYlVwb1luazRlVTFFUlhsTU1qRm9ZbGRHYjFsWE9IVmpNMlJ0','6','0','http://s.61baobao.com/zt/qinbao/2012/mamahao.swf','http://www.61baobao.com/zt/qinbao/2012/dpic/mamahao.jpg','http://www.61baobao.com/zt/qinbao/2012/pic/mamahao.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('3529','14','0','','','','1','admin','','1','0','1343236592','0','0','0','0','','','3529','0','0','0','0','0','0','哆来咪','1343236592','/spic/20120725/1964.jpg','0','1','1343236592','0','3','1','0','','0','','/d/file/swf/duolaimi.swf','667','479','来吧 让我们一起来学习<br />最好就是从头起<br />要念书 先得学会<br />A B C<br />要唱歌 先得学会<br />duo lai mi<br />duo lai mi<br />duo lai mi<br />是最先碰到的三个音级<br />duo lai mi<br />duo lai mi<br />duo lai mi fa suo la xi<br /><br />哦 让我想想<br />怎么才能好记一点<br />嗯 有了<br />duo（多）好朋友多呀多<br />lai（来）快来呀来唱歌<br />mi（眯）她脸上笑眯眯<br />fa（发）要发出光和热<br />suo（锁）能拴住门和窗<br />la（拉）是用力往回拖<br />xi（西）那太阳往西落<br />回头我们又唱duo（多）<br />oh oh oh<br /><br />dduo（多）好朋友多呀多<br />lai（来）快来呀来唱歌<br />mi（眯）她脸上笑眯眯<br />fa（发）要发出光和热<br />suo（锁）能拴住门和窗<br />la（拉）是用力往回拖<br />xi（西）那太阳往西落<br />回头我们又唱duo（多）<br />oh oh oh<br />duo lai mi fa suo la xi<br />duo suo duo','1','','0','','1','/dpic/20120725/1965.jpg','11159','VEROd01Fd3pSbkJpYlVwb1luazRlVTFFUlhsTU1sSXhZako0YUdGWE1YQk1iazR6V21jOVBRPT0=','0','0','http://s.61baobao.com/zt/qinbao/2012/duolaimi.swf','http://www.61baobao.com/zt/qinbao/2012/dpic/duolaimi.jpg','http://www.61baobao.com/zt/qinbao/2012/pic/duolaimi.jpg','0','三个月以上','0','','0','','0','0','0');");
