E_D("replace into `phome_ecms_game` values('3544','14','0','','','','1','admin','|26|','1','0','1343236597','0','0','0','0','','','3544','0','0','0','0','0','0','鲁冰花','1343236597','/spic/20120725/1994.jpg','0','1','1343236597','0','3','1','0','','0','','/d/file/swf/lubinghua.swf','667','479','夜夜想起妈妈的话 ,闪闪的泪光鲁冰花 ,天上的星星不说话 ,地上的娃娃想妈妈 ,天上的眼睛眨呀眨 ,妈妈的心呀鲁冰花 ,家乡的茶园开满花 ,妈妈的心肝在天涯 ,夜夜想起妈妈的话 ,闪闪的泪光鲁冰花 ,啊 ,夜夜想起妈妈的话 ,闪闪的泪光鲁冰花 ,啊 ,夜夜想起妈妈的话 ,闪闪的泪光 ,(唱)闪闪的泪光 ,我知道半夜的星星会唱歌 ,想家的夜晚它就这样和我一唱一和 ,我知道午后的清风会唱歌 ,童年的蝉声它总是跟风一唱一和 ,当手中握妆华 ,心情却变得荒芜 ,才发现世上一切都会变卦 ,当青春剩下日记 ,乌丝就要变成白发 ,不变的只有那首歌 ,在心中来回地唱 .','1','','0','','1','/dpic/20120725/1995.jpg','10763','VEROd01Fd3pSbkJpYlVwb1luazRlVTFFUlhsTU1uZ3hXVzFzZFZveWFERlpVelY2WkRKWlBRPT0=','0','0','http://s.61baobao.com/zt/qinbao/2012/lubinghua.swf','http://www.61baobao.com/zt/qinbao/2012/dpic/lubinghua.jpg','http://www.61baobao.com/zt/qinbao/2012/pic/lubinghua.jpg','0','三个月以上','0','','0','','0','0','0');");
