E_D("replace into `phome_ecms_game` values('3560','14','0','','','','1','admin','|24|','1','0','1343236602','0','0','0','0','','','3560','0','0','0','0','0','0','快乐的节日','1343236602','/spic/20120725/2026.jpg','0','1','1343236602','0','3','1','0','','0','','/d/file/swf/0170.swf','667','479','小鸟在前面带路,风儿吹向我们,我们像春天一样,来到花园里 来到草地上,鲜艳的红领巾,美丽的衣裳,像许多花儿开放,跳啊跳啊跳啊,跳啊跳啊跳啊,亲爱的叔叔阿姨们,同我们一起过呀过这快乐的节日；花儿向我们点头,白杨树哗啦啦地响,它们同美丽的小鸟,向我们祝福 向我们歌唱,它们都说世界上,有我们就更美丽,世界上有我们就更美丽 ,跳啊跳啊跳啊,跳啊跳啊跳啊,亲爱的叔叔阿姨们,同我们一起过呀过这快乐的节日；感谢亲爱的祖国,让我们自由的成长,我们像小鸟一样,等身上的羽毛长得丰满,就勇敢地向着高空去飞翔,飞向我们的理想,跳啊跳啊跳啊,跳啊跳啊跳啊,亲爱的叔叔阿姨们,同我们一起过呀过这快乐的节日。','1','','0','','1','/dpic/20120725/2027.jpg','10542','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1cE9IZE5WR04zVEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/06/0170.swf','http://www.61baobao.com/common/flash/2011b/06/dpic/0170.jpg','http://www.61baobao.com/common/flash/2011b/06/pic/0170.jpg','0','三个月以上','0','','0','','0','0','0');");
