E_D("replace into `phome_ecms_game` values('3565','14','0','','','','1','admin','|26|','1','0','1343236603','0','0','0','0','','','3565','0','0','0','0','0','0','哪里是我家','1343236603','/spic/20120725/2036.jpg','0','1','1343236603','0','3','1','0','','0','','/d/file/swf/0131.swf','667','479','爸爸找了新的妈妈,妈妈找了新的爸爸，哪里才是我的家呀，没有人给我回答。爸爸忘了陪我玩耍，妈妈忘了陪我说话，没有温暖和关怀呀，我应该怎样长大。爷爷奶奶看着我满眼泪花，外公外婆搂着我声音嘶哑。我心爱的玩具叫谁买啊，我好孤单我好害怕。爷爷奶奶看着我满眼泪花，外公外婆搂着我声音嘶哑。我心爱的玩具叫谁买啊，我好孤单我好害怕。','1','','0','','1','/dpic/20120725/2037.jpg','10336','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1cE9IZE5WRTE0VEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/06/0131.swf','http://www.61baobao.com/common/flash/2011b/06/dpic/0131.jpg','http://www.61baobao.com/common/flash/2011b/06/pic/0131.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('3566','14','0','','','','1','admin','','1','0','1343236603','0','0','0','0','','','3566','0','0','0','0','0','0','雪地里的小画家','1343236603','/spic/20120725/2040.jpg','0','1','1343236603','0','3','1','0','','0','','/d/file/swf/0159.swf','667','479','下雪啦，下雪啦！雪地里来了一群小画家。小鸡画竹叶，小狗画梅花，小鸭画枫叶，小马画月牙。不用颜料不用笔，几步就成一幅画。青蛙为什么没参加？它在洞里睡着啦!','1','','0','','1','/dpic/20120725/2041.jpg','10364','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1cE9IZE5WRlUxVEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/06/0159.swf','http://www.61baobao.com/common/flash/2011b/06/dpic/0159.jpg','http://www.61baobao.com/common/flash/2011b/06/pic/0159.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('3567','14','7','','','','1','admin','','1','0','1343236604','0','0','0','0','','','3567','0','0','0','0','0','0','打花巴掌','1343236604','/spic/20120725/2038.jpg','0','1','1343236604','0','3','1','0','','0','','/d/file/swf/0168.swf','667','479','打花巴掌的，一月一，我们从小爱学习。提着篮子去采花，茉莉花呀海棠花，江西腊那个野菊花，采朵玫瑰花呀，采朵牡丹花牡丹花。 　　打花巴掌的，二月二，我们从小爱画画。提着篮子去采花，茉莉花呀海棠花，江西腊那个野菊花，采朵玫瑰花呀，采朵牡丹花牡丹花。 　　打花巴掌的，三月三，我们从小爱爬山。提着篮子去采花，茉莉花呀海棠花，江西腊那个野菊花，采朵玫瑰花呀，采朵牡丹花牡丹花。 　　打花巴掌的，四月四，我们从小爱写字。提着篮子去采花，茉莉花呀海棠花，江西腊那个野菊花，采朵玫瑰花呀，采朵牡丹花牡丹花。','1','','0','','1','/dpic/20120725/2039.jpg','10540','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1cE9IZE5WRmswVEc1T00xcG5QVDA9','7','0','http://s.61baobao.com/common/flash/2011b/06/0168.swf','http://www.61baobao.com/common/flash/2011b/06/dpic/0168.jpg','http://www.61baobao.com/common/flash/2011b/06/pic/0168.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('3569','14','0','','','','1','admin','','1','0','1343236604','0','0','0','0','','','3569','0','0','0','0','0','0','亲亲妞猪猪','1343236604','/spic/20120725/2042.jpg','0','1','1343236604','0','3','1','0','','0','','/d/file/swf/0130.swf','667','479','喝奶奶你的脚别乱踹，淘气就罚你站在门外，有问题要多问一个why，走路时候屁股别乱摆，吃饭饭前把手洗白白，看见蝴蝶你不要发呆，生病了要勇敢的对待，长大以后要把握未来，喔乖~，亲亲猪猪宝贝，宠爱你不累不累，每一天给你的爱是一千倍，亲亲猪猪宝贝，陪伴你夜空很美，把快乐都告诉了全世界 every day，上课一定不要开小差，回答问题把头抬起来，毕业的pose要好好摆，从现在起做个乖小孩。','1','','0','','1','/dpic/20120725/2043.jpg','10335','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1cE9IZE5WRTEzVEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/06/0130.swf','http://www.61baobao.com/common/flash/2011b/06/dpic/0130.jpg','http://www.61baobao.com/common/flash/2011b/06/pic/0130.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('3571','14','0','','','','1','admin','','1','0','1343236604','0','0','0','0','','','3571','0','0','0','0','0','0','一起去郊游','1343236604','/spic/20120725/2046.jpg','0','1','1343236604','0','3','1','0','','0','','/d/file/swf/0158.swf','667','479','走 走 走走走，我们小手牵小手，走 走 走走走，我们去郊游，白云悠悠，阳光柔柔，青山绿水一片锦绣，走 走 走走走，我们去郊游。','1','','0','','1','/dpic/20120725/2047.jpg','10363','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1cE9IZE5WRlUwVEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/06/0158.swf','http://www.61baobao.com/common/flash/2011b/06/dpic/0158.jpg','http://www.61baobao.com/common/flash/2011b/06/pic/0158.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('3572','14','0','','','','1','admin','','1','0','1343236604','0','0','0','0','','','3572','0','0','0','0','0','0','我唱歌儿','1343236604','/spic/20120725/2044.jpg','0','1','1343236604','0','3','1','0','','0','','/d/file/swf/0165.swf','667','479','青青的草，红红的花，我唱歌儿骑着马；什么马？大马；什么大？天大；什么天？青天；什么青？山青；什么山？高山；什么高？塔高；什么塔？宝塔；什么宝？国宝；什么国？我爱中华人民共和国。','1','','0','','1','/dpic/20120725/2045.jpg','10537','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1cE9IZE5WRmt4VEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/06/0165.swf','http://www.61baobao.com/common/flash/2011b/06/dpic/0165.jpg','http://www.61baobao.com/common/flash/2011b/06/pic/0165.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('3574','14','0','','','','1','admin','','1','0','1343236605','0','0','0','0','','','3574','0','0','0','0','0','0','我很丑','1343236605','/spic/20120725/2048.jpg','0','1','1343236605','0','3','1','0','','0','','/d/file/swf/0129.swf','667','479','每一个晚上，在梦的旷野，我是骄傲的巨人，每一个早晨，在浴室的镜子前，却发现自己活在剃刀边缘，在钢筋水泥的丛林里，在呼来唤去的生涯里，计算着梦想和现实之间的差距，我很丑，可是我很温柔，外表冷漠，内心狂热，那就是我，可是我有音乐和啤酒，一点卑微一点懦弱，可是从不退缩，在都市的边缘，我是孤独的假面，在音乐的旷野，却变成狂热嘶吼的巨人，在一望无际舞台上，在不被了解另一面，发射出生活和自我的尊严，白天黯淡，夜晚不朽，有时激昂，有时低首，非常善于等候。','1','','0','','1','/dpic/20120725/2049.jpg','10334','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1cE9IZE5WRWsxVEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/06/0129.swf','http://www.61baobao.com/common/flash/2011b/06/dpic/0129.jpg','http://www.61baobao.com/common/flash/2011b/06/pic/0129.jpg','0','三个月以上','0','','0','','0','0','0');");
