E_D("replace into `phome_ecms_game` values('3603','14','0','','','','1','admin','','1','0','1343236609','0','0','0','0','','','3603','0','0','0','0','0','0','跨世界的新一代','1343236609','/spic/20120725/2082.jpg','0','1','1343236609','0','3','1','0','','0','','/d/file/swf/04.swf','667','479','跨世纪的金鼓敲起来，跨世纪的银号吹起来，跨世纪的星星升起来，跨世纪的火炬举起来，跟着太阳，跨世纪，拥抱明天，新世界，手挽手，朝前迈，我们是跨世纪的新一代，跨世纪的旗帜飘起来，跨世纪的歌儿唱起来，跨世纪的理想树起来，跨世纪的重任接过来，举着火炬，跨世纪，朝气蓬勃，向未来，为祖国，争光彩，我们是跨世纪的新一代。','1','','0','','1','/dpic/20120725/2083.jpg','10357','VEROd01Fd3pSbkJpYlVwb1luazRlVTFFUlhoTWVrRXdURzVPTTFwblBUMD0=','0','0','http://s.61baobao.com/zt/qinbao/2011/04.swf','http://www.61baobao.com/zt/qinbao/2012/dpic/liuyi.jpg','http://www.61baobao.com/zt/qinbao/2012/pic/liuyi.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('3605','14','0','','','','1','admin','','1','0','1343236610','0','0','0','0','','','3605','0','0','0','0','0','0','今天我值日','1343236610','/spic/20120725/2080.jpg','0','1','1343236610','0','3','1','0','','0','','/d/file/swf/04.swf','667','479','像一只快乐的小鸟，轻轻地，轻轻地，飞进教室。我像一个神奇的魔术师，悄悄地，悄悄地，创造奇迹。大黑板擦得更明亮，小桌椅排的多整齐，地上没有没有一点灰，同学们来了多高兴多高兴。啦啦啦啦啦啦啦啦啦啦啦啦啦啦今天我值日。','1','','0','','1','/dpic/20120725/2081.jpg','10356','VEROd01Fd3pSbkJpYlVwb1luazRlVTFFUlhoTWVrRXdURzVPTTFwblBUMD0=','0','0','http://s.61baobao.com/zt/qinbao/2011/04.swf','http://www.61baobao.com/zt/qinbao/2012/dpic/xiaoxiaoshaonian.jpg','http://www.61baobao.com/zt/qinbao/2012/pic/xiaoxiaoshaonian.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('3608','14','2','','','','1','admin','','1','0','1343236610','0','0','0','0','','','3608','0','0','0','0','0','0','狗狗未来不是梦','1343236610','/spic/20120725/2084.jpg','0','1','1343236610','0','3','1','0','','0','','/d/file/swf/0141.swf','667','479','鸡年过去了狗年要来到，我们都想要去放鞭炮， 向天空叫叫把尾巴摇摇，狗狗本命年马上要来到。 享受着阳光， 紫外线穿破臭氧会把皮肤晒伤。呼吸新鲜空气， 可吸入颗粒物超标最好别出去。 我要吃外卖， 一次性餐盒多数都不合格。 那我吃快餐， 当心苏丹红像可怕的毛毛虫。 那你说我们到底吃什么，总不能在家里干等着挨饿。 打开冰箱看一看是劣质的奶粉，还有包裹细菌可怕的保鲜膜。 听说就连牙膏还有不沾锅，都可能给我们带来恐怖病魔。 电脑、手机、微波炉到处都是辐射， 你说、你说，这日子怎么过？ 狗狗未来不是梦，要放心的过每一分钟， 不用担心毛毛虫，也不会为了吃而感到头疼。 狗狗未来不是梦，要健康的过每一分钟， 只要坚持做运动，一定会强壮得像头狗熊，壮得像头狗熊。 我想吃棒棒糖，吃多了影响健康而且还会发胖。 我想喝红高粱，喝高了容易误事还会损害肝脏。 可是工作压力大，要学会自我解压体力不能透支花。 总是心情不好，笑一笑十年少没有什么大不了。 你没听人家说过心理健康很重要吗？ 做男人最重要的就是心胸宽大。 任何事都以一颗平常心去对待它， 本命年咱的事业一定会有大变化。 你看看05年勇敢的小鸡、小鸭， 乐观的面对生活，精神多么伟大， 接下来2006就得看咱的啦！ 可不能丢人啊，站直了别趴下！ 狗狗未来不是梦，要勇敢的过每一分钟，忘掉所有的苦痛，摇摇尾巴去争取成功。 狗未来不是梦，要坚强的过每一分钟， 虽然不是优良品种，也要努力成为狗中英雄，成为狗中英雄！','1','','0','','1','/dpic/20120725/2085.jpg','10346','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1cE9IZE5WRkY0VEc1T00xcG5QVDA9','2','0','http://s.61baobao.com/common/flash/2011b/06/0141.swf','http://www.61baobao.com/common/flash/2011b/06/dpic/0141.jpg','http://www.61baobao.com/common/flash/2011b/06/pic/0141.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('3609','14','0','','','','1','admin','','1','0','1343236610','0','0','0','0','','','3609','0','0','0','0','0','0','61儿童节快乐','1343236610','/spic/20120725/2086.jpg','0','1','1343236610','0','3','1','0','','0','','/d/file/swf/0150.swf','667','479','12345，上山打老虎。老虎没打到，打到小松鼠。松鼠有几只，让我数一数。数来有数去，12345','1','','0','','1','/dpic/20120725/2087.jpg','10355','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1cE9IZE5WRlYzVEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/06/0150.swf','http://www.61baobao.com/common/flash/2011b/06/dpic/0150.jpg','http://www.61baobao.com/common/flash/2011b/06/pic/0150.jpg','0','三个月以上','0','','0','','0','0','0');");
