E_D("replace into `phome_ecms_game` values('3614','14','0','','','','1','admin','','1','0','1343236611','0','0','0','0','','','3614','0','0','0','0','0','0','孩子和羽毛','1343236611','/spic/20120725/2090.jpg','0','1','1343236611','0','3','1','0','','0','','/d/file/swf/0140.swf','667','479','我象个孩子坐在树梢,摊开手掌接住一片羽毛,空气里水鸟细声歌唱,向树林里寻找留下记号,穿越黑暗城市我找到了你,披着白色羽毛,脸上的光亮反射向四周,我象个孩子一样,任性地欢笑贪婪地索要,星空下柔软海绵想念孤独的水鸟,你会带我温暖地飞啊，飞啊，毫无方向,你的气息是亲人的气息，让我失去了抵抗,闭上眼 世界很虚幻,时间是 凝固不动的,我不能 属于任何地点,抓住我 不要放手,我象个孩子用眼泪说话,每个夜晚掉落许多羽毛,没有人知道我能飞翔,从天空里降落到遥远的海岸,在寂寞飞行中我对你说话,那奇妙的地方藏着秘密的梦中之国,我象个孩子一样,任性地欢笑,放纵地挥霍,让你感觉到我细微的情绪变化,你不会让它们象羽毛一样落到地上,你摊开手掌接受了它们,当我的碎片渐渐都落到了你的身上,你会变得沉重，我却变得轻盈,可以飞到更远的地方,看着你下落，你坠落,在我的海里浮沉 将羽毛浸湿,看着你下落，你坠落,在我的海里浮沉,象孩子一样哭泣,象孩子一样无助,抑制不住的悲伤.','1','','0','','1','/dpic/20120725/2091.jpg','10345','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1cE9IZE5WRkYzVEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/06/0140.swf','http://www.61baobao.com/common/flash/2011b/06/dpic/0140.jpg','http://www.61baobao.com/common/flash/2011b/06/pic/0140.jpg','0','三个月以上','0','','0','','0','0','0');");

